// Add copy button functionality
new ClipboardJS('.copy-button', {
    target: function(trigger) {
        return trigger.previousElementSibling;
    }
}).on('success', function(e) {
    e.clearSelection()
});

$(document).ready(function () {

    // Add copy button and tooltip to each code-block
    $('pre').each(function () {
        $(this).append('<button class="copy-button tooltip" title="Copied!"><i class="far fa-fw fa-copy"></i></button>')
    });

    $('.tooltip').tooltipster({
        animationDuration: 1,
        theme: 'tooltipster-light',
        side: 'bottom',
        delay: [200, 0],
        distance: 0,
        trigger: 'custom',
        triggerOpen: {
            click: true,
            tap: true
        },
        triggerClose: {
            click: true,
            tap: true,
            mouseleave: true
        }
    });

    // Nav-Toggle
    $(".toggler").click(function () {
        $("nav").slideToggle();
        $("#search").autocomplete("val", "");
    });

    // Keyboard-Support
    $(document).keyup(function (e) {
        // Clear and/or close search on ESC
        if (e.code === 'Escape' && $("#search")[0] == $(e.target)[0]) {
            if (!$("nav").hasClass('permanentTopNav')) {
                $("nav").slideUp();
            }
            $("#search").autocomplete("val", "").blur();
            return;
        }

        // Ignore event if we're inside a input field
        let targetType = (e.target.tagName ?? "").toLowerCase();
        if (targetType == "textarea" || targetType == "input") {
            return;
        }

        // Else we listen for "s" to active out search box
        if (e.code === 'KeyS') {
            if (!$("nav").hasClass('permanentTopNav')) {
                $("nav").slideDown();
            }
            $("#search").focus();
        }
    })

    // Flexslider
    $('.flexslider').flexslider({
        animation: "slide",
        prevText: "",
        nextText: "",
        pauseOnHover: true,
    });

    dimbox.setConfig({
        showDownloadButton: false
    });
    dimbox.init();

    // Back to top button
    $(window).scroll(function() {
        if ($(window).scrollTop() > 300) {
            $('#back-to-top-button').addClass('show');
        } else {
            $('#back-to-top-button').removeClass('show');
        }
    });

    $('#back-to-top-button').on('click', function(e) {
        e.preventDefault();
        $('html, body').animate({scrollTop:0}, '300');
    });

    // Toggle menu items on small screens
    $('.menu-toggle').on('click', function (e) {
        e.preventDefault();
        $(this).closest('.menu-wrapper').toggleClass('active');
    });

    // Close menu when clicking outside
    $(document).on('click', function (e) {
        if (!$(e.target).closest('.menu-wrapper').length) {
            $('.menu-wrapper').removeClass('active');
        }
    });

});
